},
"software": {
"python": "3.x",
"theano": "latest"
},
"libraries": [
"ImportanceSamplingSGD"
],
"dependencies": {
"ImportanceSamplingSGD": "https://github.com/alexmlamb/ImportanceSamplingSGD.git"
},
"environment_variables": {
"IMPORTANCE_SAMPLING_SGD_ROOT": "${HOME}/Documents/ImportanceSamplingSGD",
"PYTHONPATH": "${PYTHONPATH}:${IMPORTANCE_SAMPLING_SGD_ROOT}",
"IMPORTANCE_SAMPLING_SGD_BIN": "${IMPORTANCE_SAMPLING_SGD_ROOT}/integration_distributed_training/bin",
"CONFIG_FILE": "${IMPORTANCE_SAMPLING_SGD_ROOT}/integration_distributed_training/config_files/helios/12_repeat20x030/config_00074.py",
"BOOTSTRAP_FILE": "${HOME}/bootstrap_experiment_00074"
},
"processes": [
"run_database.py",
"run_master.py",
"run_worker.py"
],
"command_line_arguments": {
"run_database.py": "--config_file=${CONFIG_FILE} --bootstrap_file=${BOOTSTRAP_FILE}",
"run_master.py": "--config_file=${CONFIG_FILE} --bootstrap_file=${BOOTSTRAP_FILE}",
"run_worker.py": "--config_file=${CONFIG_FILE} --bootstrap_file=${BOOTSTRAP_FILE}"
},
"execution_order": [
"run_database.py",
"run_master.py",
"run_worker.py"
],
"execution_details": {
